import React, { useState, useEffect } from 'react';
import { useAuth } from '../Context/AuthContext';
import { 
    getWishlist, 
    removeFromWishlist,
    moveToCart
} from '../Services/wishlistService';
import { Link } from 'react-router-dom';
import './Wishlist.css';

const WishlistPage = () => {
    const { user } = useAuth();
    const [wishlist, setWishlist] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        const fetchWishlist = async () => {
            if (!user) return;
            
            try {
                setLoading(true);
                const { success, items, error } = await getWishlist(user._id);
                
                if (success) {
                    setWishlist(items);
                    setError('');
                } else {
                    setError(error);
                }
            } catch (err) {
                setError('Failed to load wishlist');
            } finally {
                setLoading(false);
            }
        };
        
        fetchWishlist();
    }, [user]);

    const handleRemoveItem = async (productId) => {
        try {
            const { success } = await removeFromWishlist(user._id, productId);
            if (success) {
                setWishlist(wishlist.filter(item => item.productId._id !== productId));
            }
        } catch (err) {
            setError('Failed to remove item');
        }
    };

    const handleMoveToCart = async (productId) => {
        try {
            const { success } = await moveToCart(user._id, productId);
            if (success) {
                setWishlist(wishlist.filter(item => item.productId._id !== productId));
            }
        } catch (err) {
            setError('Failed to move item to cart');
        }
    };

    if (!user) {
        return (
            <div className="wishlist-container">
                <h2>My Wishlist</h2>
                <p>Please log in to view your wishlist</p>
                <Link to="/login" className="login-link">Log In</Link>
            </div>
        );
    }

    if (loading) {
        return (
            <div className="wishlist-container">
                <h2>My Wishlist</h2>
                <div className="loading-spinner"></div>
            </div>
        );
    }

    return (
        <div className="wishlist-container">
            <h2>My Wishlist</h2>
            {error && <div className="error-message">{error}</div>}
            
            {wishlist.length === 0 ? (
                <div className="empty-wishlist">
                    <p>Your wishlist is empty</p>
                    <Link to="/products" className="browse-btn">
                        Browse Products
                    </Link>
                </div>
            ) : (
                <div className="wishlist-items">
                    {wishlist.map((item) => (
                        <div key={item.productId._id} className="wishlist-item">
                            <Link 
                                to={`/products/${item.productId._id}`} 
                                className="product-link"
                            >
                                <div className="product-image">
                                    <img 
                                        src={item.productId.image || '/placeholder-product.jpg'} 
                                        alt={item.productId.name}
                                    />
                                </div>
                                <div className="product-info">
                                    <h3>{item.productId.name}</h3>
                                    <p className="price">Rs. {item.productId.price.toFixed(2)}</p>
                                    <p className="category">{item.productId.category}</p>
                                </div>
                            </Link>
                            <div className="item-actions">
                                <button
                                    onClick={() => handleMoveToCart(item.productId._id)}
                                    className="move-to-cart"
                                >
                                    Move to Cart
                                </button>
                                <button
                                    onClick={() => handleRemoveItem(item.productId._id)}
                                    className="remove-item"
                                >
                                    Remove
                                </button>
                            </div>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};

export default Wishlist;
